import React from "react";
import experience from "./data/dataExperience";
import {Container} from 'react-bootstrap';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
function Experience() {
  return (
    <>
      <section id="experience" className="container experience-section">
        <div className="exp-title">
          <h1>Experience</h1>
        </div>
        <div className="exp-card-group">
          {experience.map((curElem) => {
            const { id, position, company, timePeriod, location, skill } =
              curElem;
            return (
              <>
                {/* <div className="col-sm-6">{position}</div>
                <div className="row exp" key={id}>
                  <div className="row exp-card">
                    <div className="col-sm-6">{company}</div>
                    <div className="col-sm-6">{timePeriod}</div>
                  </div>
                  <div className="row exp-card">
                    <div className="col-sm-6">{location}</div>
                    <div className="col-sm-6">{skill}</div>
                  </div>
                </div> */}
                <div className="pos" key={id}>{position}</div>
                <Container>
                  <Row>
                    <Col>{company}</Col>
                    <Col>{timePeriod}</Col>
                  </Row>
                  <Row>
                    <Col>{location}</Col>
                    <Col>{skill}</Col>
                  </Row>
                </Container>

              </>
            );
          })}
        </div>
      </section>
    </>
  );
}

export default Experience;
